%[text] # KPM计算电导率

clear;
col_tot = 128;
row_tot = 128;
t = 1;
% Magnetic flux, flux quantum as unit
% phi = ;
Temperature = 0;


H_sparse = Graphene_Armchair_Real_Sparse(col_tot, row_tot, t, "Bx", 2*pi*0.01);
[row, col] = size(H_sparse);
[x, y] = Graphene_Armchair_Real_Coords(col_tot, row_tot);
x_operator = spdiags(x, 0, row, col);
y_operator = spdiags(y, 0, row, col);
v_operator_x = 1i * sparse(H_sparse * x_operator - x_operator * H_sparse);
v_operator_y = 1i * sparse(H_sparse * y_operator - y_operator * H_sparse);

tic;
%%
%% KPM计算电导率
N_randvec = 5;
N_moments = ceil(3*row_tot);
N_points = 2 * N_moments+1;
% N_points = 400;
[H_tilde, a, b] = KPM_scaleHamiltonian(H_sparse);
e_scaled = KPM_Chebyshev_abscissas(N_points);
energies = e_scaled * a + b;

%%
% sigma_xx
Moments_Mat = KPM_Moments_Correlator(H_tilde, N_randvec, N_moments, v_operator_x, v_operator_x, 'gpu');
Moments_Kernel = KPM_Kernel_Correction(Moments_Mat, N_moments);
integral = zeros(1, length(energies));
integral_factor = zeros(1, length(energies));
for ii = 1:length(e_scaled)
    Gamma = KPM_Correlator_basis(e_scaled(ii), N_moments);
    integral_factor(ii) = tensorprod(Moments_Kernel, Gamma.','all');
end

for ii = 1:length(energies)
    fermi_distribution = KPM_fermi_distribution(energies, energies(ii), Temperature);
    integrand = (fermi_distribution ./ ((1 - e_scaled.^2).^2)) .* integral_factor;
    integral(ii) = trapz(e_scaled, integrand);
end
prefactor = 2*4^2/((2*a)^2);
Conductivity_xx = prefactor * integral;

% sigma_xy
Moments_Mat = KPM_Moments_Correlator(H_tilde, N_randvec, N_moments, v_operator_x, v_operator_y, 'gpu');
Moments_Kernel = KPM_Kernel_Correction(Moments_Mat, N_moments,'Lorentz');

integral_factor = zeros(1, length(energies));

for ii = 1:length(e_scaled)
    Gamma = KPM_Correlator_basis(e_scaled(ii), N_moments);
    integral_factor(ii) = tensorprod(Moments_Kernel, Gamma.','all');
end
for ii = 1:length(energies)
    fermi_distribution = KPM_fermi_distribution(energies, energies(ii), Temperature);
    integrand = (fermi_distribution ./ ((1 - e_scaled.^2).^2)) .* integral_factor;
    integral(ii) = trapz(e_scaled, integrand);
end
Conductivity_xy = prefactor * integral;


toc; %[output:3b48527f]
%%
% plot(energies, real(Conductivity_xx),energies, real(Conductivity_xy));
plot(energies, real(Conductivity_xy),energies, imag(Conductivity_xx)); %[output:19de475c]
legend({'$Re\sigma_{xy}$','$Im\sigma_{xy}$'},'interpreter','latex') %[output:19de475c]
% hold off
% legend({'$\sigma_{xx}$','$\sigma_{xy}$'},'interpreter','latex')


